import Link from 'next/link';
import { GoSearch } from 'react-icons/go';

const linkStyle = {
  fontSize: 35
};

const Header = () => (
  <nav className="navbar bg-light">
    <Link href="/">
      <a style={linkStyle}>Les recettes de Martine</a>
    </Link>
    <ul className="navbar-bar">
      <li>
        <Link href="/about">
          <button>Ajouter une recette </button>
        </Link>
      </li>
      <li>
        <Link href="/">
          <a><GoSearch/> Rechercher</a>
        </Link>
      </li>
      <li>
        <Link href="/">
          <a>Profil</a>
        </Link>
      </li>
    </ul>
  </nav>
);

export default Header;
